data.explanationText:
The code:

 var x = 5;
 var y = 2;

set the character 'x' to equal 5 and the character 'y' to equal 2. When we say

 print (x-y)

 we are telling the program to tell us what the value of (x-y) is, which is 5 - 2 = 3!

data.questionText:
What is the output of the following code:

 var x = 5;
 var y = 2;
 print (x-y);

data.hintText:
Here's a similar example!

 var x = 10;
 print x;

 This code outputs 10.
